import React, { Component } from "react";
import './css/style.css';
import { saveAs } from "./download";

class Image extends Component {
    // download(value){
    //     saveAs(value);
    // }
    render() { 
        let imgArray= this.props.obj;
        return ( 
        <React.Fragment>
     {
            imgArray.map((value,index)=>

                <div id="img" key={index}style={{position:'relative'}}>
                    <a href="" download></a><img style={{width:"300px", height:"500px"}} src={value} className='image' onClick={()=>{
                        saveAs(value)
                    }}
                 alt="Images"/>

                    <img src="/download.png" className="middle" />
                </div>
            )
        }
        </React.Fragment>)

    }
}
export default Image;
